CREATE DATABASE IF NOT EXISTS northgate;

USE northgate;

DROP TABLE IF EXISTS amendments;

CREATE TABLE `amendments` (
  `cashoutamount` decimal(65,0) default NULL,
  `cash` varchar(111) default NULL,
  `stand` varchar(111) default NULL,
  `date` datetime default NULL,
  `id` int(255) NOT NULL auto_increment,
  `capturer` varchar(255) default NULL,
  `month` varchar(111) default NULL,
  `year` varchar(111) default NULL,
  `authority` varchar(111) default NULL,
  `a_type` varchar(111) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=187 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS amends;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `amends` AS select `stand`.`id_stand` AS `id_stand`,`stand`.`number` AS `number`,`amendments`.`cash` AS `cash`,`amendments`.`date` AS `date`,`amendments`.`capturer` AS `capturer`,`amendments`.`authority` AS `authority`,`amendments`.`a_type` AS `a_type` from (`amendments` join `stand` on((`stand`.`id_stand` = `amendments`.`stand`)));




