DROP TABLE IF EXISTS logsview;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `logsview` AS select `systemlogs`.`details` AS `details`,`systemlogs`.`detailsdate` AS `detailsdate`,`systemlogs`.`user` AS `user`,`systemlogs`.`logtype` AS `logtype`,`systemlogs`.`id_logs` AS `id_logs`,`users`.`id` AS `id`,`users`.`name` AS `name`,`users`.`surname` AS `surname`,`users`.`sex` AS `sex`,`users`.`email` AS `email`,`users`.`account` AS `account`,`users`.`address` AS `address`,`users`.`department` AS `department`,`users`.`username` AS `username`,`users`.`password` AS `password`,`users`.`idnumber` AS `idnumber`,`users`.`status` AS `status`,`users`.`date` AS `date`,`users`.`access` AS `access`,`users`.`suspend` AS `suspend` from (`systemlogs` join `users` on((`users`.`username` = `systemlogs`.`user`)));




DROP TABLE IF EXISTS owners;

CREATE TABLE `owners` (
  `client_id` varchar(111) default NULL,
  `owners_date` datetime default NULL,
  `stand_id` varchar(111) default NULL,
  `owners_id` int(255) NOT NULL auto_increment,
  PRIMARY KEY  (`owners_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1051 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS payment;

CREATE TABLE `payment` (
  `cash` decimal(65,0) default NULL,
  `stand` varchar(111) default NULL,
  `date` datetime default NULL,
  `id` int(255) NOT NULL auto_increment,
  `capturer` varchar(255) default NULL,
  `month` varchar(111) default NULL,
  `year` varchar(111) default NULL,
  `payment_type` varchar(111) default NULL,
  `d` varchar(111) default NULL,
  `payment_date` varchar(111) default NULL,
  `value_date` varchar(111) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=25681 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS payments;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `payments` AS select `stand`.`number` AS `number`,`payment`.`cash` AS `cash`,`payment`.`payment_type` AS `payment_type`,`payment`.`month` AS `month`,`payment`.`payment_date` AS `payment_date`,`stand`.`months_paid` AS `months_paid`,`payment`.`capturer` AS `capturer`,`stand`.`datestatus` AS `datestatus`,`payment`.`value_date` AS `value_date` from (`payment` join `stand`) where ((`payment`.`stand` = `stand`.`id_stand`) and (`payment`.`payment_type` = _latin1'credit')) group by `payment`.`id`,`payment`.`value_date` order by `payment`.`id`;




DROP TABLE IF EXISTS sms_response;

CREATE TABLE `sms_response` (
  `id` bigint(20) NOT NULL auto_increment,
