  `message` text,
  `status` int(11) default '0',
  `month` varchar(111) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS stand;

CREATE TABLE `stand` (
  `location` varchar(111) default NULL,
  `area` decimal(65,0) default NULL,
  `number` varchar(111) default NULL,
  `status` varchar(111) default 'For_Sale',
  `id_stand` int(111) NOT NULL auto_increment,
  `price` decimal(65,0) default NULL,
  `date` datetime default NULL,
  `deposit` decimal(65,0) default NULL,
  `instalments` varchar(111) default NULL,
  `datestatus` datetime default NULL,
  `months_paid` varchar(111) default NULL,
  `start_instalment` varchar(111) default NULL,
  `vatdate` datetime default NULL,
  `vat` varchar(111) default NULL,
  PRIMARY KEY  (`id_stand`)
) ENGINE=MyISAM AUTO_INCREMENT=664 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS standowners;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `standowners` AS select `stand`.`number` AS `number`,`stand`.`area` AS `area`,`stand`.`location` AS `location`,`stand`.`price` AS `price`,`stand`.`datestatus` AS `purchasedate`,`stand`.`deposit` AS `deposit`,`stand`.`instalments` AS `instalments`,`stand`.`months_paid` AS `months_paid`,`clients`.`name` AS `NAME`,`clients`.`surname` AS `surname`,`clients`.`address` AS `address`,`clients`.`email` AS `email`,`clients`.`contact` AS `contact`,`clients`.`idnum` AS `idnum`,`clients`.`dob` AS `dob` from ((`stand` join `owners`) join `clients`) where ((`owners`.`stand_id` = `stand`.`id_stand`) and (`owners`.`client_id` = `clients`.`id`)) order by `stand`.`number`;




DROP TABLE IF EXISTS standssold;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `standssold` AS select `stand`.`location` AS `location`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`deposit` AS `deposit`,`stand`.`status` AS `STATUS`,`stand`.`instalments` AS `instalments`,`stand`.`datestatus` AS `purchasedate`,`stand`.`id_stand` AS `id_stand`,sum(`payment`.`cash`) AS `depositpaid` from (`stand` join `payment` on((`stand`.`id_stand` = `payment`.`stand`))) where ((`stand`.`status` in (_latin1'Payment_In_Progress',_latin1'Deposit_Outstanding')) and (`payment`.`payment_type` = _latin1'Deposit')) group by `payment`.`stand`;




DROP TABLE IF EXISTS systemlogs;

CREATE TABLE `systemlogs` (
