  `detailsdate` datetime default NULL,
  `user` varchar(255) default NULL,
  `logtype` varchar(111) default NULL,
  `id_logs` int(11) NOT NULL auto_increment,
  PRIMARY KEY  (`id_logs`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS thismonthpaid;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `thismonthpaid` AS select `payment`.`cash` AS `cash`,`payment`.`stand` AS `stand`,`payment`.`date` AS `date`,`payment`.`id` AS `id`,`payment`.`capturer` AS `capturer`,`payment`.`month` AS `MONTH`,`payment`.`year` AS `YEAR`,`payment`.`payment_type` AS `payment_type`,`payment`.`d` AS `d`,`payment`.`payment_date` AS `payment_date`,`payment`.`value_date` AS `value_date`,`stand`.`id_stand` AS `id_stand`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`instalments` AS `instalments`,`stand`.`deposit` AS `deposit`,`stand`.`datestatus` AS `datestatus`,`stand`.`months_paid` AS `months_paid` from (`payment` join `stand` on((`stand`.`id_stand` = `payment`.`stand`))) where ((`payment`.`value_date` between convert(date_format(now(),_utf8'%Y-%m-01 00:00:00') using latin1) and convert(date_format(now(),_utf8'%Y-%m-%d 00:00:00') using latin1)) and (`payment`.`payment_type` = _latin1'credit')) group by `payment`.`stand` order by `payment`.`value_date` desc;




DROP TABLE IF EXISTS threemonths;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `threemonths` AS select `payment`.`cash` AS `cash`,`payment`.`stand` AS `stand`,`payment`.`date` AS `date`,`payment`.`id` AS `id`,`payment`.`capturer` AS `capturer`,`payment`.`month` AS `MONTH`,`payment`.`year` AS `YEAR`,`payment`.`payment_type` AS `payment_type`,`payment`.`d` AS `d`,`payment`.`payment_date` AS `payment_date`,`payment`.`value_date` AS `value_date`,`stand`.`id_stand` AS `id_stand`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`instalments` AS `instalments`,`stand`.`deposit` AS `deposit`,`stand`.`datestatus` AS `datestatus`,`stand`.`months_paid` AS `months_paid` from (`payment` join `stand` on((`stand`.`id_stand` = `payment`.`stand`))) where (not(`payment`.`stand` in (select `payment`.`stand` AS `stand` from (`payment` join `stand` on((`stand`.`id_stand` = `payment`.`stand`))) where ((`payment`.`value_date` > convert(date_format((now() - interval 3 month),_utf8'%Y-%m-%d 00:00:00') using latin1)) and (`payment`.`payment_type` = _latin1'credit')) group by `payment`.`stand`))) group by `payment`.`stand` order by `payment`.`value_date` desc;




DROP TABLE IF EXISTS threemonthspaid;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `threemonthspaid` AS select `payment`.`cash` AS `cash`,`payment`.`stand` AS `stand`,`payment`.`date` AS `date`,`payment`.`id` AS `id`,`payment`.`capturer` AS `capturer`,`payment`.`month` AS `MONTH`,`payment`.`year` AS `YEAR`,`payment`.`payment_type` AS `payment_type`,`payment`.`d` AS `d`,`payment`.`payment_date` AS `payment_date`,`payment`.`value_date` AS `value_date`,`stand`.`id_stand` AS `id_stand`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`instalments` AS `instalments`,`stand`.`deposit` AS `deposit`,`stand`.`datestatus` AS `datestatus`,`stand`.`months_paid` AS `months_paid` from (`payment` join `stand` on((`stand`.`id_stand` = `payment`.`stand`))) where ((`payment`.`value_date` > convert(date_format((now() - interval 3 month),_utf8'%Y-%m-%d 00:00:00') using latin1)) and (`payment`.`payment_type` = _latin1'credit')) group by `payment`.`stand` order by `payment`.`value_date` desc;




DROP TABLE IF EXISTS twomonthspaid;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `twomonthspaid` AS select `payment`.`cash` AS `cash`,`payment`.`stand` AS `stand`,`payment`.`date` AS `date`,`payment`.`id` AS `id`,`payment`.`capturer` AS `capturer`,`payment`.`month` AS `MONTH`,`payment`.`year` AS `YEAR`,`payment`.`payment_type` AS `payment_type`,`payment`.`d` AS `d`,`payment`.`payment_date` AS `payment_date`,`payment`.`value_date` AS `value_date`,`stand`.`id_stand` AS `id_stand`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`instalments` AS `instalments`,`stand`.`deposit` AS `deposit`,`stand`.`datestatus` AS `datestatus`,`stand`.`months_paid` AS `months_paid` from (`payment` join `stand` on((`stand`.`id_stand` = `payment`.`stand`))) where ((`payment`.`value_date` > convert(date_format((now() - interval 2 month),_utf8'%Y-%m-%d 00:00:00') using latin1)) and (`payment`.`payment_type` = _latin1'credit')) group by `payment`.`stand` order by `payment`.`value_date` desc;




